import {useEffect, useState} from 'react'
export default function App() {

  const [data, setData] = useState(null);
  useEffect(() => {
    fetch('/steam/userGames')
      .then(res => res.json())
      .then(res => setData(res.message));
  }, []);

  return (
    <div>
      {data}
    </div>
  );
}
